import React, { Component } from "react"
import { Grid, Cell } from "react-mdl"

class Education extends Component {
    render() {
        return(
            <Grid>
                <Cell col={4}>
                    Left Side
                </Cell>

                <Cell col={4}>
                    Right Side
                </Cell>
            </Grid>
        )
    }
}

export default Education
